import React from "react";
import { Link } from "react-router-dom";

function Header() {
    return (
        <header>
            <nav>
                <ul>
                    <li>
                        <Link to='/'>Accueil</Link>
                    </li>
                    <li>
                        <Link to='/trending'>Trending</Link>
                    </li>
                    <li>
                        <Link to='/last-year'>2022</Link>
                    </li>
                    <li>
                        <Link to='/current-ye'>2023</Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
